import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app-wrapper">
      <header className='header'>
        <img src="https://www.iguides.ru/upload/iblock/e19/e19d6ea90a6b90e7ee7c53f0de2eb400.jpg" alt="Tut fotka"/>
      </header>
      <nav className="nav">
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
      </nav>
      <div className='content'>
        <b>Content</b>

      </div>
    </div>
  );
}

export default App;
